import React from 'react';

import './error.css';

document.addEventListener("DOMContentLoaded", function () {

    let body = document.body;
    setInterval(createStar, 100);
    function createStar() {
        let right = Math.random() * 500;
        let top = Math.random() * body.screen.height;
        let star = document.createElement("div");
        star.classList.add("star")
        body.appendChild(star);
        setInterval(runStar, 10);
        star.style.top = top + "px";
        function runStar() {
            if (right >= body.screen.width) {
                star.remove();
            }
            right += 3;
            star.style.right = right + "px";
        }
    }
})

const Error = () => {
    //return <div className="error">Error</div>
    return (
        <>
            <div className="text">
                <div>ERROR</div>
                <h1>404</h1>
                <hr />
                <div>Page Not Found</div>
            </div>

            <div className="astronaut">
                <img src="https://images.vexels.com/media/users/3/152639/isolated/preview/506b575739e90613428cdb399175e2c8-space-astronaut-cartoon-by-vexels.png" alt="" class="src" />
            </div>
        </>
    )

}

export default Error;
